description:
Soldier Blue - som bygger pa en bildlig historisk sammandrabbning mellan vita nybyggare och vasterns Cheyenneindianer - ar ett valdsamt drama som berattar om den amerikanska soldaten Honus Gant och den vita kvinnan Cresta och deras kamp. Tva ar tidigare tillfangatogs de av indianer, och de ar de enda overlevande efter Cheyenneindianernas massaker pa en grupp ur det amerikanska kavalleriet....




